import React from 'react';

const Calendar = () => {
    return (
      <div>
        <h2></h2>
        <iframe
        src="https://calendar.google.com/calendar/embed?src=emiller3425%40gmail.com&ctz=America%2FDetroit"
            style={{ border: 4, width: '800px', height: '600px' }}
          frameBorder="0"
        ></iframe>
      </div>
    );
  };

  export default Calendar;
